import '../assets/'

function TestPage () {
    return (
      <div>
        <nav class="side">
          <div class="side__inner">
            <div class="top">
              <a href="#">Volker Otto</a>
            </div>
            <div class="bottom">
              <a href="https://dribbble.com/hellovolker">
                DRIBBBLE
              </a>
              <a href="https://twitter.com/hellovolker">
                TWITTER
              </a>
              <a href="mailto:hello@volkerotto.net">
                EMAIL ME
              </a>
            </div>
          </div>
        </nav>
      </div>
    );
}
function HomePage() {
  return (
    <div>
          <h1>Home Page</h1>


    </div>
  );
}

export default HomePage;
